contents:
Thank you to 
@MNPDNashville
 and 
@NashvilleFD
 for your extra hard work today and the days to come.

At 6:32 Christmas morning, 
@MNPDNashville
 and 
@NashvilleFD
 responded to the scene of an explosion on 2nd Ave, approximately one block north of Broadway. Metro Police confirm the source of the explosion came from a vehicle.

Bless you, Jill, William and Darius at the 
@Fly_Nashville
 @SouthwestAir
 counter, for rerouting us when our flight was delayed today.

Wanna say MERRY CHRISTMAS to ALL my Oregon and 
@trailblazers
 friends! 
@RipCityGeneral
 @KristenKerbaugh
 @ChadinRipCity
 @travisdemers
 @L_Hurd
 @DannyMarang
 @joesimonssays
 @brookeolzendam
 @CBurkhardtNBCS

just wanna say thanks and Merry Christmas to 
@JoshBreslowWKRN
 for working all day to keep us informed and safe. we here in the Nashville area are very grateful!

I've been clear that I do not believe 
@JohnCooper4Nash
 is the right person to lead our city -- still do not. However, his ”laugh” over the bombing is not a story.  People cope with stress in different ways.  He obviously feels the pain of the city.  Let's not make this a story.
